import React from "react";

const LoginSignup = () => {
  return (
    <div className="container my-5 d-flex flex-column justify-content-center align-items-center">
      <h1 className="text-primary mb-4">Login or Sign Up</h1>
      <div className="card p-4 shadow w-100" style={{ maxWidth: "400px" }}>
        <form>
          <div className="mb-3">
            <label className="form-label">Email address</label>
            <input type="email" className="form-control" placeholder="Enter email" />
          </div>
          <div className="mb-3">
            <label className="form-label">Password</label>
            <input type="password" className="form-control" placeholder="Password" />
          </div>
          <div className="d-grid gap-2">
            <button type="submit" className="btn btn-primary">Login</button>
            <button type="button" className="btn btn-outline-primary">Sign Up</button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default LoginSignup;
